import React from 'react';
import '../'

export default function Header() {
    return (
        <header>
            <div className="header__logo-container">
                <img src="../../assets/Logo/Logo-brainflix.svg" alt="brainflix logo" className="header__logo" />
            </div>
            <h1 className="header__title">BrainFlix</h1>

            <button className="header__button">upload</button>
            <div className="header__img-container">
                <img src="../../assets/Logo/Images/Mohan-muruge.jpg" alt="user profile default" className="header__img" />
            </div>
        </header>
    )
}
